package script.db.groovy.mogu_admin


databaseChangeLog(logicalFilePath: 'script/db/groovy/mogu_admin/categorymenu.groovy') {
    changeSet(id: '2021-12-02-t-categorymenu', author: '15077731547@163.com') {
        createTable(tableName: "t_category_menu", remarks: '菜单表') {
            column(name: 'uid', type: 'VARCHAR(32)', remarks: '唯一uid')
                    { constraints(primaryKey: true) }
            column(name: 'name', type: 'VARCHAR(255)', remarks: '菜单名称')
                    { constraints(nullable: false) }
            column(name: 'menu_level', type: 'TINYINT(1)', remarks: '菜单级别')
                    { constraints(nullable: true) }
            column(name: 'summary', type: 'VARCHAR(200)', remarks: '简介')
                    { constraints(nullable: true) }
            column(name: 'parent_uid', type: 'VARCHAR(32)', remarks: '父uid')
                    { constraints(nullable: true) }
            column(name: 'url', type: 'VARCHAR(255)', remarks: 'url地址')
                    { constraints(nullable: true) }
            column(name: 'icon', type: 'VARCHAR(50)', remarks: '图标')
                    { constraints(nullable: true) }
            column(name: 'sort', type: 'INT(11)', remarks: '排序字段，越大越靠前', defaultValue: 0)
                    { constraints(nullable: true) }
            column(name: 'status', type: 'TINYINT(3) UNSIGNED', remarks: '状态', defaultValue: 1)
                    { constraints(nullable: false) }
            column(name: 'create_time', type: 'TIMESTAMP', remarks: '创建时间', defaultValue: '0000-00-00 00:00:00')
                    { constraints(nullable: false) }
            column(name: 'update_time', type: 'TIMESTAMP', remarks: '更新时间', defaultValue: '0000-00-00 00:00:00')
                    { constraints(nullable: false) }
            column(name: 'is_show', type: 'TINYINT(1)', remarks: '是否显示 1:是 0:否', defaultValue: 0)
                    { constraints(nullable: false) }
            column(name: 'menu_type', type: 'TINYINT(1)', remarks: '菜单类型 0: 菜单   1: 按钮', defaultValue: 0)
                    { constraints(nullable: false) }
            column(name: 'is_jump_external_url', type: 'TINYINT(1)', remarks: '是否跳转外部链接 0：否，1：是', defaultValue: 0)
                    { constraints(nullable: true) }
        }
    }


